import React from 'react';
import {Link} from 'react-router-dom';
const Menu = () =>{
    return(
        <>
        <Link>About us</Link>
        <Link>Contact us</Link>
        <br/>
          <a href="/">About</a>
          <a href="/">Contact</a>
        </>
    )
}

export default Menu;
